073895811,-42.44518935297793,0],[-73.62341073895811,-42.44524993486056,0]]]]},"properties":{"id":"ID_00003","name":"Profundidad de la inundación: 4 a 6 m","description":"\"1ra Edición agosto 2019\"\n\nLas características físicas naturales del territorio donde se emplaza la localidad de Curaco de Vélez, sumado al uso de su borde costero, plantean la necesidad de evaluar adecuadamente la amenaza de tsunami a la que se encuentra sometida.\n\nEl Servicio Hidrográfico y Oceanográfico de la Armada (SHOA), ha elaborado una Carta que define las áreas que potencialmente podrían inundarse en caso que ocurriera un tsunami de gran tamaño. Dicha información se obtuvo mediante la aplicación de una metodología de simulación numérica, considerada hoy como una de las técnicas más confiables para el estudio de estos fenómenos (Wong et al., 2006). Este método utiliza básicamente datos topográficos y batimétricos junto con información sísmica, todo ello integrado a un modelo numérico de simulación.\n\nPara obtener los resultados de la inundación, los parámetros sísmicos utilizados en el modelo fueron los estimados para un evento extremo probable según Riquelme & Mocanu (2013).\n\nNOTA IMPORTANTE: En el caso de ocurrir un tsunami, los niveles de inundación señalados por esta Carta podrían ser diferentes, dependiendo de las características del terremoto que lo genere. Esta Carta se basa en un modelo numérico, es decir, en una representación de la realidad en base a cálculos matemáticos del evento extremo probable."}},
